import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View ,Image,Button} from 'react-native';
import { Linking } from 'react-native';

export default function App() {
  return (
    <View style={styles.container}>
            <Image
        style={styles.tinyLogo}
        source={{
          uri: 'https://www.quotatrip.com/assets/cimages/logo_qt_1000.png',
        }}
      />
         <Image

        source={require('././assets/Spin-1s-200px.gif')}
      />
        <Button style={{bucolor: '#49CEE7' }}
        title="Click here to visit our website"

        onPress={() => Linking.openURL('https://www.quotatrip.com/')}
      />
       <ImageBackground source={require('././assets/montagne.jpg')} resizeMode="cover" style={styles.image}>
    </ImageBackground>

    </View>

  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,

    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  }, 
  image: {
    flex: 1,
    justifyContent: "center"
  },
  tinyLogo: {
    width: 150,
    height: 50,
  },

});
